package co.mobiwise.model;

public class Comment {
	
	private String comment;
	private String speedPoint;
	private String servicePoint;
	private String flavorPoint;
	private String date;
	
	public Comment() {
		// TODO Auto-generated constructor stub
	}

	public String getComment() {
		return comment;
	}

	public void setComment(String comment) {
		this.comment = comment;
	}

	public String getSpeedPoint() {
		return speedPoint;
	}

	public void setSpeedPoint(String speedPoint) {
		this.speedPoint = speedPoint;
	}

	public String getServicePoint() {
		return servicePoint;
	}

	public void setServicePoint(String servicePoint) {
		this.servicePoint = servicePoint;
	}

	public String getFlavorPoint() {
		return flavorPoint;
	}

	public void setFlavorPoint(String flavorPoint) {
		this.flavorPoint = flavorPoint;
	}

	public String getDate() {
		return date;
	}

	public void setDate(String date) {
		this.date = date;
	}
	
}
